import React, { Component } from 'react';
import logo from '../logo.svg';
import './App.css';
import Title from "./Title/title";

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="container">
          <h4 className="display-4">Hello World</h4>
            <Title name="asharful"/>
            <Title name="mahim"/>
        </div>
      </div>
    );
  }
}

export default App;
